import * as types from '../types';

export default ()=> async dispatch =>{
    const res   = await fetch('/api/usuario');
    const lista = await res.json();
    console.log(lista);

    return dispatch({
        type:types.GET_USUARIOS,
        listaUsuarios:lista.data
    })
}
